import logo from "./logo.svg";
import "./App.css";

function MyButton() {
  return (
    <button>
      I'm a button
    </button>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>TitanEats</h1>
        <MyButton />
      </header>
    </div>
  );
} 
export default App;
